  REGI01_box5DE,
  REGI01_box5TH,
  // RegisterTranslator
  REGI02_Box1v02EN,
  REGI02_Box1v02DE,
  REGI02_Box1v02TH,
  REGI02_Box2v02EN,
  REGI02_Box2v02DE,
  REGI02_Box2v02TH,
